function fixKevinsMistake() {

  var script = $( 'script[src$="/wp-content/themes/cot/js/dist/footer.js"]' );
  var src = script.attr( 'src' ).replace( '/dist', '' )
  script.remove();
  var bs = $( 'script[src$="/wp-content/themes/cot/js/bootstrap.3.4.1.min.js"]' );
  bs.after( '<script src="' + src + '">' );

}

